"},{"internalType":"bool","name":"ok","type":"bool"}],"name":"updateWhitelistedKillerStatus","outputs":[],"stateMutability":"nonpayable","type":"function"},{"inputs":[],"name":"vaultRewardBps","outputs":[{"internalType":"uint256","name":"","type":"uint256"}],"stateMutability":"view","type":"function"},{"inputs":[{"internalType":"uint256","name":"","type":"uint256"}],"name":"vaults","outputs":[{"internalType":"address","name":"","type":"address"}],"stateMutability":"view","type":"function"},{"inputs":[{"internalType":"address","name":"","type":"address"}],"name":"whitelistedKiller","outputs":[{"internalType":"bool","name":"","type":"bool"}],"stateMutability":"view","type":"function"},{"stateMutability":"payable","type":"receive"}],"devdoc":{"kind":"dev","methods":{"accrue(uint256)":{"details":"msg.value = all of staking reward","params":{"totalStaked":"current total staked EVMOS (except staking reward)"}},"addPosition(address,uint256,uint256)":{"params":{"debtInBase":"debtAmount in EVMOS","debtToken":"debtToken Address (not vault address)","equity":"equityAmount in EVMOS"}},"changePosition(address,int256,int256,uint256)":{"details":"repayDebtInBase = msg.value - changeEquityInBaseUser should approve this firstif msg.value > 0, changeEquityInBase >= 0 since msg.value = changeEquityInBase + repayDebtInBase"},"getAccruedValue(uint256)":{"params":{"reward":"claimed staking reward"}},"owner()":{"details":"Returns the address of the current owner."},"positionInfo(address,address)":{"details":"returns position's value & debt value position value: positionValueInBase equity value: positionValueInBase - debtInBase debt value: debtInBase debt ratio: debtInBase / positionValueInBase * 100(%) kill factor: killFactorBps / 100 safety buffer: (kill factor) - (debt ratio)"},"removePosition(address)":{"details":"remove all position of debtToken vault.","params":{"debtToken":"debtToken Address (not vault address)"}},"renounceOwnership()":{"details":"Leaves the contract without owner. 