 * Glossary
 * X : Input Token
 * Y : Output Token
 * Dx : Amount of Input Token
 * Dy : Amount of Output Token
 *************************************************************/
interface ISwapHelper {

    function getDy(
        address tokenX,
        address tokenY,
        uint256 dx
    ) external view returns (uint256 dy);

    function getDx(
        address tokenX,
        address tokenY,
        uint256 dy
    ) external view returns (uint256 dx);

    function exchange(
        address tokenX,
        address tokenY,
        uint256 dx,
        uint256 minDy
    ) payable external returns (uint256 dy);
}","keccak256":"0xe085ce8733ebf477156c5859b597770ce042a1bc6f7fd04bf6d2055df3d88708","license":"UNLICENSED"},"contracts/interface/IUnbondedEvmos.sol":{"content":"// SPDX-License-Identifier: UNLICENSED
